import React, { useState, useEffect } from "react";
import axios from "axios";
import "./index.less";
import Navinput from "../component/navinput/index";
export default function height() {
  const [data, setData] = useState(null);
  useEffect(() => {
    const query = window.location.pathname.substring(8);
    console.log(query);
    const getData = async () => {
      const res = await axios.get(`https://api.fsn365.com/blocks/${query}`);
      setData(res.data.data);
      console.log(res.data.data);
    };
    getData();
  }, []);
  //   console.log(data);
  return (
    <div>
      <Navinput />
      <div className="blockscontainer">
        <h2 className="blockstext">Blocks</h2>
        <div className="bl-box">
          <div className="blockson">
            <div className="blockson-box ">
              <p>Height:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Age:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Transactions:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Block Miner:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Block Rewards:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Difficulty:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Size:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Gas Limit:</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Gas Limit:8000000</p>
              <hr size="1"></hr>
            </div>
            <div className="blockson-box ">
              <p>Parent Hash:</p>
              <hr size="1"></hr>
            </div>
          </div>
          {data && <div>{data.miner}</div>}
        </div>
      </div>
    </div>
  );
}
